import React from 'react';
class Profile extends React.Component{
    constructor(props){
        super(props);
        this.state ={
            img:"../public/heart.png",
            name: "kittty"
        }
    }


    render(){
        return (
            <div>
                <img src={this.state.img} alt='icon'></img>
                <h1>{this.state.name}</h1>
            </div>
        );
    }
}
export default Profile;
